import React from 'react';
import './denglu.css';
import {Link} from 'react-router-dom';


class Denglu extends React.Component{
	render(){
		return(
			<div>
				<div className="all">
					<span className="X">X</span>
					<div className="items">
						<div class="font-logo">登陆豆瓣</div>
						<span className="font-hui">登陆注册表示同意</span>&nbsp;&nbsp;
						<span className="font-green">豆瓣使用协议,隐私政策</span>
					</div>
					<div className="inputs">
						<input placeholder="手机号"  type="text" className="phone"></input>
						<input placeholder="密码" type="text" className="password"></input>
					</div>
					<div className="button">登陆</div>
					<div className="button">
						<Link to="/zhuce">注册</Link>
					</div>
				</div>
			</div>
		)
	}
}

export default Denglu;
